INSERT INTO `rtc_epl` VALUES (17,483952735,'快到期证券大量委托买入','select e.ymt_code as ymt_code, e.stkcode as stkcode, sum(e.orderqty*1L) as allOrderqty, sum(e.orderqty*e.orderprice) as totalAmt,\r\n(\r\ncase \r\nwhen (sum(e.orderqty/r.cirqty)*1.00>=${lowCirqtyRate} and sum(e.orderqty/r.cirqty)*1.00<${midCirqtyRate})  or (sum(e.orderqty*e.orderprice)>=${lowAmt} and sum(e.orderqty*e.orderprice)<${midAmt}) then 1\r\nwhen (sum(e.orderqty/r.cirqty)*1.00>=${midCirqtyRate} and sum(e.orderqty/r.cirqty)*1.00<${hignCirqtyRate}) or (sum(e.orderqty*e.orderprice)>=${midAmt} and sum(e.orderqty*e.orderprice)<${hignAmt}) then 2\r\nwhen sum(e.orderqty/r.cirqty)*1.00>=${hignCirqtyRate} or sum(e.orderqty*e.orderprice)>=${hignAmt} then 3\r\nend\r\n) as level,\r\nmin(e.timestamp) start_time, max(e.timestamp) end_time\r\nfrom Entrust.win:time(1 day) as e\r\nleft outer join StockWithDraw.win:time(1 day) as s \r\non e.ordergroup=s.ordersno and e.ymt_code=s.ymt_code  \r\nleft outer join method:com.jzsec.rtc.lookup.FundAssetsLookUp.getStockDataByStockCode(e.stkcode,e.market) as r \r\non e.stkcode = r.stockCode\r\nwhere  e.bsflag=\'B\' and r.cirqty!=0 and r.delistingFlag=1\r\ngroup by e.ymt_code, e.stkcode\r\nhaving sum(e.orderqty/r.cirqty)*1.00>=${lowCirqtyRate} or sum(e.orderqty*e.orderprice)>=${lowAmt}','交易当日买入大量的快到期或处于退市整理期的股票,当日累计委托数量占比总流通股本的${lowCirqtyRate}以上，成交金额达到${lowAmt}以上',1,'股票: ${stkcode}, 总的委托数量${allOrderqty}，成交金额: ${totalAmt}',2,NULL,'','',NULL,NULL,2,NULL),(18,483952883,'单客户累计大量买入风险警示股票','select d.ymt_code as ymt_code, d.zqdm as stkcode,\r\nsum(d.cjsl*1L) as cjsl, sum(d.cjsl*1.0/r.cirqty) as volRate,\r\n(\r\ncase \r\nwhen  sum(d.cjsl*1L)>=${lowVol} and  sum(d.cjsl*1L)<${midVol} and sum(d.cjsl*1.0/r.cirqty)>=${lowVolRate} and sum(d.cjsl*1.0/r.cirqty)<${midVolRate} then \'1\'\r\nwhen  sum(d.cjsl*1L)>=${midVol} and  sum(d.cjsl*1L)<${hignVol} and sum(d.cjsl*1.0/r.cirqty)>=${midVolRate} and sum(d.cjsl*1.0/r.cirqty)<${hignVolRate} then \'2\'\r\nwhen  sum(d.cjsl*1L)>=${hignVol}  and sum(d.cjsl*1.0/r.cirqty)>=${hignVolRate}  then \'3\'\r\nend\r\n) as level,min(d.timestamp) start_time, max(d.timestamp) end_time\r\nfrom Deal.win:time(6 hour) as d\r\njoin method:com.jzsec.rtc.lookup.FundAssetsLookUp.getStockDataByStockCode(d.zqdm,d.market)  as r\r\non d.zqdm=r.stockCode \r\nwhere (r.stFlag=1 or r.stFlag2=1 or r.ptFlag=1 or r.fxFlag=1 or r.delistingFlag=1) and d.bs=\'0B\'\r\ngroup by d.ymt_code,d.zqdm\r\nhaving sum(d.cjsl*1L)>=${lowVol} and sum(d.cjsl*1.0/r.cirqty)>=${lowVolRate}','单客户一天内累计大量买入风险警示股票，累计成交量达到：${lowVol}，累计成交量占总流通市值占比达到：${lowVolRate}',1,'股票代码：${stkcode}, 累计成交量：${cjsl}，累计成交量占总流通市值占比：${volRate}',2,NULL,'','',NULL,NULL,2,NULL),(19,483952995,'大额无涨跌幅限制委托','select e.ymt_code as ymt_code, e.stkcode as stkcode, e.bsflag as bsflag, sum(e.orderqty*1L) as allOrderqty, sum(e.orderqty*e.orderprice) as totalAmt,\r\n(\r\ncase \r\nwhen sum(e.orderqty/r.cirqty)*1.00>=${lowCirqtyRate} and sum(e.orderqty/r.cirqty)*1.00<${midCirqtyRate} and sum(e.orderqty*e.orderprice)>=${lowAmt} and sum(e.orderqty*e.orderprice)<${midAmt} then 1\r\nwhen sum(e.orderqty/r.cirqty)*1.00>=${midCirqtyRate} and sum(e.orderqty/r.cirqty)*1.00<${hignCirqtyRate}  and sum(e.orderqty*e.orderprice)>=${midAmt} and sum(e.orderqty*e.orderprice)<${hignAmt} then 2\r\nwhen sum(e.orderqty/r.cirqty)*1.00>=${hignCirqtyRate}   and sum(e.orderqty*e.orderprice)>=${hignAmt} then 3\r\nend\r\n) as level,\r\nmin(e.timestamp) start_time, max(e.timestamp) end_time\r\nfrom Entrust.win:time(1 day) as e \r\nleft outer join StockWithDraw.win:time(1 day) as s \r\non e.ordergroup=s.ordersno and e.ymt_code=s.ymt_code  \r\njoin method:com.jzsec.rtc.lookup.FundAssetsLookUp.getStockDataByStockCode(e.stkcode) as r \r\non e.stkcode = r.stockCode \r\nwhere s.ymt_code is null and e.bsflag=\'B\' and (r.resumeFlag =1 or r.stkname like \'N%\')\r\ngroup by e.ymt_code, e.stkcode,e.bsflag\r\nhaving sum(e.orderqty/r.cirqty)*1.00>=${lowCirqtyRate} and sum(e.orderqty*e.orderprice)>=${lowAmt}','监控频繁炒作无涨跌幅限制证券, 累计委托金额超过${lowAmt}且累计委托数量超过流通股本比例超过${lowCirqtyRate}',2,'股票代码：${stkcode} , 委托方式：${bsflag}, 累计委托金额：${totalAmt}， 委托数量：${allOrderqty}',2,NULL,'','',NULL,NULL,2,NULL),(20,484018110,'短时间内密集成交','select d.ymt_code as ymt_code,d.zqdm as stkcode,min(d.timestamp) start_time, max(d.timestamp) end_time,sum(d.cjsl*1L) as allcjsl,count(distinct d.cjbh) as orderCnt,\r\n(case \r\nwhen ((sum(cjsl/r.cirqty)>=${lowRate} and count(distinct d.cjbh)>=${lowtime}) or count(distinct d.cjbh)>=${lowAlltime}) and ((sum(cjsl/r.cirqty)<${midRate} and count(distinct d.cjbh)<${midtime}) or count(distinct d.cjbh)<${midAlltime}) then 1\r\nwhen ((sum(cjsl/r.cirqty)>=${midRate} and count(distinct d.cjbh)>=${midtime}) or count(distinct d.cjbh)>=${midAlltime}) and ((sum(cjsl/r.cirqty)<${highRate} and count(distinct d.cjbh)<${hightime}) or count(distinct d.cjbh)<${highALltime}) then 2\r\nwhen ((sum(cjsl/r.cirqty)>=${highRate} and count(distinct d.cjbh)>=${hightime}) or count(distinct d.cjbh)>=${highALltime}) then 3\r\nend \r\n) as level \r\nfrom Deal.win:time_batch(5 min) as d \r\njoin method:com.jzsec.rtc.lookup.FundAssetsLookUp.getStockDataByStockCode(d.zqdm,d.market)  as r \r\non r.stockCode = d.zqdm \r\ngroup by d.ymt_code,d.zqdm,d.bs\r\nhaving (sum(cjsl/r.cirqty)>=${lowRate} and count(distinct d.cjbh)>=${lowtime}) or count(distinct d.cjbh)>=${lowAlltime}','监控短时间内，委托方向不同，同一客户频发成交， 累计成交数量 / 流通股本>=${lowRate}且累计成交次数>=${lowtime}；或者累计委托成交次数>= ${lowAlltime}',1,'证券代码${stkcode}，累计成交数量${allcjsl}，累计委托成交次数${orderCnt}',2,NULL,'','',NULL,NULL,2,NULL),(21,484025114,'单个股票涨跌停委托','select a.ymt_code as ymt_code,a.bsflag as bsflag, a.stkcode as stkcode ,min(a.timestamp) start_time, max(a.timestamp) end_time,sum(a.orderqty*1L) as allorderqty,sum(a.orderqty/r.cirqty) as orderqtyRate,\r\n (\r\n case \r\n when sum(a.orderqty/r.cirqty)>= ${lowRate} and sum(a.orderqty/r.cirqty)<${midRate} then  \'1\'\r\n when sum(a.orderqty/r.cirqty)>= ${midRate} and sum(a.orderqty/r.cirqty)<${highRate} then  \'2\'\r\n when sum(a.orderqty/r.cirqty)>= ${highRate}  then  \'3\'\r\nend \r\n) as level \r\nfrom  EntrustDB.win:time(6 hour) as a \r\nleft outer join StockWithDrawDB.win:time(6 hour) as b  \r\non a.orderid=b.orderid and a.ymt_code=b.ymt_code   \r\n join method:com.jzsec.rtc.lookup.FundAssetsLookUp.getStockDataByStockCode(a.stkcode,a.market) as r \r\non a.stkcode = r.stockCode  \r\nwhere ((a.orderprice+${orderpriceRate}*r.maxRiseValue)>=r.maxRiseValue  and  a.bsflag=\'0B\') or ((a.orderprice-${orderpriceRate}*r.maxDownValue)<=r.maxDownValue and a.bsflag=\'0S\') and b.ymt_code is null\r\ngroup by a.ymt_code,a.stkcode,a.bsflag\r\nhaving sum(a.orderqty/r.cirqty) is not null and sum(a.orderqty/r.cirqty)>= ${lowRate}','监控以涨停价或接近涨停价格大量委托买入某证券，委托价格与涨停价格的幅度<=${orderpriceRate}，且当日累计委托数量占比>=${lowRate}',1,'证券代码：${stkcode},累计委托数量：${allorderqty}, 累计委托数量占比:${orderqtyRate}, 买卖方向：${bsflag}',2,NULL,'','','2017-07-27',NULL,2,NULL),(23,484029983,'短时间内密集委托','select a.ymt_code as ymt_code,a.stkcode as stkcode,min(a.timestamp) start_time, max(a.timestamp) end_time,sum(a.orderqty*1L) as allorderqty,count(1) as orderCnt,\r\n(case \r\nwhen ((sum(orderqty/r.cirqty)>=${lowRate} and count(1)>=${lowtime}) or count(1)>=${lowAlltime}) and ((sum(orderqty/r.cirqty)<${midRate} and count(1)<${midtime}) or count(1)<${midAlltime}) then 1\r\nwhen ((sum(orderqty/r.cirqty)>=${midRate} and count(1)>=${midtime}) or count(1)>=${midAlltime}) and ((sum(orderqty/r.cirqty)<${highRate} and count(1)<${hightime}) or count(1)<${highALltime}) then 2\r\nwhen ((sum(orderqty/r.cirqty)>=${highRate} and count(1)>=${hightime}) or count(1)>=${highALltime}) then 3\r\nend \r\n) as level \r\nfrom Entrust.win:time(5 min) as a left outer join StockWithDraw.win:time(5 min) b on a.ymt_code=b.ymt_code and a.ordergroup=b.ordersno join method:com.jzsec.rtc.lookup.FundAssetsLookUp.getStockDataByStockCode(a.stkcode,a.market) as r on r.stockCode = a.stkcode  where b.ymt_code is null group by a.ymt_code,a.stkcode,a.bsflag having (sum(orderqty/r.cirqty)>=${lowRate} and count(1)>=${lowtime}) or count(1)>=${lowAlltime}','监控短时间内，同一客户频繁委托下单，不同的委托方向累计委托数量 / 流通股本>=${lowRate}， 且累计委托次数>=${lowtime}；或者累计委托次数>=${lowAlltime}',1,'证券代码${stkcode}，累计委托数量${allorderqty}，累计委托次数${orderCnt}',2,NULL,'','',NULL,NULL,2,NULL),(24,484030699,'当日累计大量委托','select e.ymt_code as ymt_code ,e.stkcode as stkcode , min(cast(e.timestamp,long)) as start_time , max(cast(e.timestamp,long)) as end_time ,sum(e.orderqty*1L) as  allOrderqty,\r\nsum(cast(e.orderqty,long)*cast(e.orderprice,double)) as allAmt,\r\n(case \r\n  when sum(e.orderqty/r.cirqty) >= ${lowEntrustRate} and sum(e.orderqty/r.cirqty) < ${midEntrustRate} or sum(cast(e.orderqty,long)*cast(e.orderprice,double)) >= ${lowSumPrice} and sum(cast(e.orderqty,long)*cast(e.orderprice,double)) < ${midSumPrice} then 1\r\n  when sum(e.orderqty/r.cirqty) >= ${midEntrustRate} and sum(e.orderqty/r.cirqty) < ${higEntrustRate} or sum(cast(e.orderqty,long)*cast(e.orderprice,double)) >= ${midSumPrice} and sum(cast(e.orderqty,long)*cast(e.orderprice,double)) < ${higSumPrice} then 2 \r\n  when sum(e.orderqty/r.cirqty) >= ${higEntrustRate} or sum(cast(e.orderqty,long)*cast(e.orderprice,double)) >= ${higSumPrice} then 3\r\n  end\r\n) as level \r\nfrom Entrust.win:time(1 day) as e \r\njoin method:com.jzsec.rtc.lookup.FundAssetsLookUp.getStockDataByStockCode(e.stkcode,e.market) as r \r\non e.stkcode = r.stockCode \r\ngroup by e.ymt_code,e.stkcode\r\nhaving sum(e.orderqty/r.cirqty) >= ${lowEntrustRate} or sum(cast(e.orderqty,long)*cast(e.orderprice,double)) >= ${lowSumPrice}','监控当日累计委托数量占比>=${lowEntrustRate} 或者 累计委托金额>=${lowSumPrice} 的操作',1,'股票代码：${stkcode}，当天累计委托数量:${allOrderqty} , 累计委托金额:${allAmt}',2,NULL,'','',NULL,NULL,2,NULL),(25,484033179,'短时间内密集撤单','select s.ymt_code as ymt_code, s.stkcode as stkcode,min(s.timestamp) as start_time , max(s.timestamp) as end_time ,\r\n sum(s.orderqty/r.cirqty) as cancelRate, count(*) as cancelCnt,\r\n(case \r\n	when (sum(s.orderqty/r.cirqty)>=${lowCancelRate} and sum(s.orderqty/r.cirqty) <${midCancelRate} and count(*) >=${lowFewCancelCnt} and count(*) <${midFewCancelCnt} ) or (count(*) >=${lowCancelCnt} and count(*) <${midCancelCnt}) then 1 \r\n	when (sum(s.orderqty/r.cirqty)>=${midCancelRate} and sum(s.orderqty/r.cirqty) <${higCancelRate} and count(*) >=${midFewCancelCnt} and count(*) <${higFewCancelCnt}) or (count(*) >=${midCancelCnt} and count(*) <${higCancelCnt}) then 2\r\n	when (sum(s.orderqty/r.cirqty)>=${higCancelRate} and count(*)>=${higFewCancelCnt}) or count(*) >=${higCancelCnt} then 3 \r\nend) as level \r\nfrom StockWithDrawDB.win:time(5 min) as s\r\njoin method:com.jzsec.rtc.lookup.FundAssetsLookUp.getStockDataByStockCode(s.stkcode,s.market) as r \r\non s.stkcode=r.stockCode \r\ngroup by s.ymt_code, s.stkcode \r\nhaving (sum(s.orderqty/r.cirqty)>=${lowCancelRate} and count(*)  >=${lowFewCancelCnt}) or count(*)  >=${lowCancelCnt}','监控近五分钟内,累计撤单委托数量占比>=${lowCancelRate} 且累计撤单委托次数>=${lowFewCancelCnt},或者累计撤单委托次数>=${lowCancelCnt} 的操作',1,'股票代码：${stkcode} , 累计撤单委托数量占比:${cancelRate} , 累计撤单委托次数 : ${cancelCnt}',2,NULL,'','',NULL,NULL,2,NULL),(28,484274869,'日内大量虚假申报','select e.ymt_code as ymt_code, e.stkcode as stkcode, e.bsflag as bsflag,\r\nsum(case when s.ymt_code is not null then 1.0 else 0.0 end)/count(*) as drawRate,\r\nsum(case when s.ymt_code is not null then 1.0 else 0.0 end) as drawCnt,\r\nsum(case when s.ymt_code is not null then e.orderqty*1.0 else 0.0 end) as drawVal,\r\nsum((case when s.ymt_code is not null then e.orderqty*1.0 else 0.0 end)/r.cirqty) as drawValRate,\r\n(\r\ncase \r\nwhen sum(case when s.ymt_code is not null then 1.0 else 0.0 end)/count(*) >=${lowDrawRate} and sum(case when s.ymt_code is not null then 1.0 else 0.0 end)/count(*) <${midDrawRate} and sum((case when s.ymt_code is not null then e.orderqty*1.0 else 0.0 end)/r.cirqty)  >=${lowDrawValRate} and sum((case when s.ymt_code is not null then e.orderqty*1.0 else 0.0 end)/r.cirqty)  <${midDrawValRate} then 1\r\nwhen sum(case when s.ymt_code is not null then 1.0 else 0.0 end)/count(*) >=${midDrawRate} and sum(case when s.ymt_code is not null then 1.0 else 0.0 end)/count(*) <${hignDrawRate} and sum((case when s.ymt_code is not null then e.orderqty*1.0 else 0.0 end)/r.cirqty)  >=${midDrawValRate} and sum((case when s.ymt_code is not null then e.orderqty*1.0 else 0.0 end)/r.cirqty) <${hignDrawValRate} then 2\r\nwhen sum(case when s.ymt_code is not null then 1.0 else 0.0 end)/count(*) >=${hignDrawRate} and sum((case when s.ymt_code is not null then e.orderqty*1.0 else 0.0 end)/r.cirqty)  >=${hignDrawValRate} then 3\r\nend\r\n) as level,\r\nmin(e.timestamp) as start_time, max(e.timestamp) as end_time\r\nfrom EntrustDB.win:time(6 hour) as e \r\nleft outer join  StockWithDrawDB.win:time(6 hour) as  s\r\non e.ymt_code=s.ymt_code and e.orderid=s.orderid\r\njoin method:com.jzsec.rtc.lookup.FundAssetsLookUp.getStockDataByStockCode(e.stkcode,e.market) as r \r\non e.stkcode = r.stockCode \r\ngroup by e.ymt_code,e.stkcode,e.bsflag\r\nhaving sum(case when s.ymt_code is not null then 1.0 else 0.0 end)/count(*)>=${lowDrawRate} and sum((case when s.ymt_code is not null then e.orderqty*1.0 else 0.0 end)/r.cirqty)>=${lowDrawValRate}','在开盘集合竞价可撤销申报期间，客户累计委托数量占流通股本${lowDrawValRate}比例，然后在9.20之前迅速撤单，撤单率在${lowDrawRate}以上',1,'证券代码：${stkcode},委托数量占流通股本比例: ${drawValRate}, 撤单率: ${drawRate},撤单次数：${drawCnt}, 撤单委托量：${drawVal}',2,NULL,'','',NULL,NULL,2,NULL),(35,495184026,'申报并快速撤单监控','select s.ymt_code as ymt_code,\r\nsum(case when s.interval>=0 and s.interval <=${interval} then 1 else 0 end) as wcnt,\r\nmin(s.timestamp) as start_time,max(s.timestamp) as end_time\r\nfrom StockWithDrawDB.win:time(6 hour) as s\r\ngroup by s.ymt_code\r\nhaving sum(case when s.interval>=0 and s.interval <=${interval} then 1 else 0 end)>=${wcnt}','${interval}秒内完成申报并撤销申报，且日内出现${wcnt}次以上',1,'一码通：${ymt_code}, 日内申报并快速撤单次数：${wcnt}',2,NULL,'','',NULL,NULL,2,NULL);
