INSERT INTO `rtc_query_fun` VALUES (2,1,'委托指令查询',410411,'SELECT fundid, stkcode, timestamp AS timestamp, orderprice, orderqty,bsflag\r\nFROM ${db}/${schemaId} \r\nWHERE ymt_code=\'${ymt_code}\' and timestamp>=${start_time} and timestamp<=${end_time}','SELECT fundid, stkcode, count(*) AS cnt\r\nFROM ${db}/${schemaId} \r\nWHERE ymt_code=\'${ymt_code}\' and timestamp>=${start_time} and timestamp<=${end_time}\r\ngroup by  fundid, stkcode'),(16,410411,'委托指令IP查询',410411,'SELECT fundid, stkcode, timestamp AS timestamp,  orderprice, orderqty, netaddr, mac,bsflag  FROM ${db}/${schemaId} \r\nWHERE ymt_code=\'${ymt_code}\' and timestamp>=${start_time} and timestamp<=${end_time}','SELECT fundid, netaddr, count(*) AS cnt FROM ${db}/${schemaId} WHERE ymt_code=\'${ymt_code}\' and timestamp>=${start_time} and timestamp<=${end_time}  GROUP BY fundid, netaddr'),(17,548250124,'登录指令查询',410301,'SELECT fundid, timestamp AS timestamp, netaddr AS ip, mac FROM rtc*/${schemaId} WHERE ymt_code=\'${ymt_code}\' and timestamp>=${start_time} and timestamp<=${end_time}',''),(18,459862747,'成交回报查询',200000,'SELECT ymt_code, zqdm, timestamp AS timestamp, cjbh, cjsl, cjjg,cjje,bs  FROM ${db}/${schemaId}  WHERE ymt_code=\'${ymt_code}\' and timestamp>=${start_time} and timestamp<=${end_time}','SELECT ymt_code, zqdm, count(distinct cjbh) AS cnt FROM ${db}/${schemaId} WHERE ymt_code=\'${ymt_code}\' and timestamp>=${start_time} and timestamp<=${end_time} and zqdm=\'${stkcode}\' GROUP BY ymt_code, zqdm'),(19,603487196,'成交回报营业部查询',200000,'SELECT custid, zqdm, timestamp AS timestamp, cjbh, cjsl, cjjg,cjje,bs  FROM ${db}/${schemaId}  WHERE orgid=\'${orgid}\' and zqdm=\'${zqdm}\' and timestamp>=${start_time} and timestamp<=${end_time}','SELECT zqdm, orgid, custid, count(*) AS cnt, count(distinct custid) AS custCnt FROM ${db}/${schemaId} WHERE orgid=\'${orgid}\' and zqdm=\'${zqdm}\' and timestamp>=${start_time} and timestamp<=${end_time}  GROUP BY zqdm, orgid,custid'),(20,483406881,'频繁转账查询',410605,'SELECT fundid, banktrantype, timestamp AS timestamp, tranamt\r\nFROM ${db}/${schemaId} \r\nWHERE ymt_code=\'${ymt_code}\' and timestamp>=${start_time} and timestamp<=${end_time}','SELECT fundid, banktrantype, count(*) AS transferCnt, sum(tranamt) AS transferAmt\r\nFROM ${db}/${schemaId} \r\nWHERE ymt_code=\'${ymt_code}\' and timestamp>=${start_time} and timestamp<=${end_time}\r\ngroup by  fundid, banktrantype');
